import React, { Component } from 'react';
import "./TaskList.css"
import {library} from '@fortawesome/react-fontawesome'
import {faTrash} from '@fortawesome/react-fontawesome'

function TaskList(props)  {



        const items = props.taskItems;
        const itemsListToShow = items.map(item=>{
            return (
                <div id="list" key="items.key">
                    <p id="listPara">{item.text}</p>
                </div>
            );

        })

        return(
            <div>
                {itemsListToShow}
            </div>
        );
    }



export default TaskList;
